INSERT INTO `act_re_model` VALUES ('10001', '15', '工时填报（人力外包）模型', '10001', null, '2019-01-03 10:26:57.907', '2019-01-24 09:36:01.980', '1', '{\"name\":\"工时填报（人力外包）模型\",\"revision\":1,\"description\":\"工时填报（人力外包）流程，由外包人员发起申请，项目经理审批，经理通过后，进入下一节点，归档于项目经理和外包人员\"}', null, '10002', '10003', '');
INSERT INTO `act_re_model` VALUES ('180001', '6', '项目变更流程模型', '180001', null, '2019-05-17 12:16:30.980', '2019-06-24 11:16:19.306', '1', '{\"name\":\"项目变更流程模型\",\"revision\":1,\"description\":\"项目变更流程：\\n申请人发起变更，科技项目经理进行确认，确认不通过则退回至发起人，通过后流向pmo初审；\\npmo审批：驳回则退回到项目经理确认节点，通过则再判断条件：非重大项目 and 非重大变更 and 变更类型 等于 计划变更都成立时，归档并结束流程；条件不成立则启动oa系统中的流程，挂起当前流程，待oa系统的流程通过后回到当前流程，激活流程，判断是否为需求变更，不是的话直接归档当前流程；是需求变更的话，进行需求分析，分析驳回后退回到pmo初审，分析通过后进行需求分析确认节点，确认通过后流程归档。\"}', null, '180002', '180003', '');
INSERT INTO `act_re_model` VALUES ('182501', '4', '关联需求提交模型', '182501', null, '2019-05-17 13:59:54.354', '2019-05-17 14:07:22.569', '1', '{\"name\":\"关联需求提交模型\",\"revision\":1,\"description\":\"关联需求提交流程：产品经理下载需求说明书进行拆分明细后重命名，然后上传，并指定各系统负责人，即业务经理确认；业务经理如果驳回，则退回至产品经理，业务经理如果确认通过，则流程归档至发起人。\"}', null, '182502', '182503', '');
INSERT INTO `act_re_model` VALUES ('187503', '6', '架构评审流程模型', '187503', null, '2019-05-22 13:51:41.763', '2019-06-11 09:51:49.089', '1', '{\"name\":\"架构评审流程模型\",\"revision\":1,\"description\":\"架构评审流程：项目经理提交评审申请，然后架构联席评审委员会判定并线下组织架构评审，评审后由申请人提交评审结果，由架构联席评委审批，确认是否需要复评，是的话退回到项目经理提交评审申请重新申请，不需要复评则归档结束流程\"}', null, '187504', '187505', '');
INSERT INTO `act_re_model` VALUES ('230001', '5', '立项流程模型', '230001', null, '2019-05-31 10:21:40.341', '2019-05-31 11:32:00.648', '1', '{\"name\":\"立项流程模型\",\"revision\":1,\"description\":\"立项流程：由业务经理提出并上传需求说明书，由架构师经理进行立项初审，立项初审通过后由发起人确认，确认通过后提交至oa系统相关流程，oa系统相关流程审批通过后由pmo进行实际立项；立项后归档至发起人。\"}', null, '230002', '230003', '');
INSERT INTO `act_re_model` VALUES ('235001', '4', '需求提交流程模型', '235001', null, '2019-05-31 11:34:26.314', '2019-05-31 12:00:49.321', '1', '{\"name\":\"需求提交流程模型\",\"revision\":1,\"description\":\"需求提交流程：由业务经理提出并上传需求说明书，由产品创新中心审批；产创审批人如果退回，则业务经理重新上传需求说明书；产创审批人如果确认则经产品经理进行需求分析；产品经理可以：1、驳回则退回至发起人重新申请，2、转发：指派给其他产品经理执行；3、自己先签收任务，然后下载需求说明书进行拆分明细后分析重命名，如果通过则指定各系统负责人，即业务经理确认；业务经理如果驳回，则退回至产品经理，业务经理如果确认通过，则流程归档至发起人。\"}', null, '235002', '235003', '');
INSERT INTO `act_re_model` VALUES ('7501', '22', '工时填报（项目外包/行内人员）模型', '7501', null, '2019-01-03 09:50:38.582', '2019-01-24 09:36:47.634', '1', '{\"name\":\"工时填报（项目外包/行内人员）模型\",\"revision\":1,\"description\":\"工时填报（项目外包/行内人员）流程，由项目外包人员或行内人员发起申请，项目经理审批，需要所有的项目的经理通过后，才可通过；进入下一节点，归档于项目经理和项目外包人员或行内人员\"}', null, '7502', '7503', '');
INSERT INTO `act_re_procdef` VALUES ('architectureReviewProcess:1:240012', '1', 'http://www.activiti.org/processdef', '架构评审流程', 'architectureReviewProcess', '1', '240009', '架构评审流程模型.bpmn20.xml', '架构评审流程模型.architectureReviewProcess.png', '架构评审流程：项目经理提交评审申请，然后架构联席评审委员会判定并线下组织架构评审，评审后由申请人提交评审结果，架构评审组联系评委审批，确认是否需要复评，是的话退回到项目经理提交评审申请重新申请，不需要复评则归档结束流程', '0', '1', '1', '');
INSERT INTO `act_re_procdef` VALUES ('associatedDemandProcess:1:240016', '1', 'http://www.activiti.org/processdef', '关联需求提交流程', 'associatedDemandProcess', '1', '240013', '关联需求提交模型.bpmn20.xml', '关联需求提交模型.associatedDemandProcess.png', '关联需求提交流程：产品经理下载需求说明书进行拆分明细后重命名，然后上传，并指定各系统负责人，即业务经理确认；业务经理如果驳回，则退回至产品经理，业务经理如果确认通过，则流程归档至发起人。', '0', '1', '1', '');
INSERT INTO `act_re_procdef` VALUES ('monthlyreportForProjectProcess:1:250004', '1', 'http://www.activiti.org/processdef', '工时填报（项目外包/行内人员）', 'monthlyreportForProjectProcess', '1', '250001', '工时填报（项目外包/行内人员）模型.bpmn20.xml', '工时填报（项目外包/行内人员）模型.monthlyreportForProjectProcess.png', '工时填报（项目外包/行内人员）流程，适用于项目外包人员和行内人员，由项目外包人员或行内人员发起申请，项目经理审批，需要所有的项目的经理通过后，才可通过；进入下一节点，归档于项目经理和项目外包人员或行内人员', '0', '1', '1', '');
INSERT INTO `act_re_procdef` VALUES ('projectChangeProcess:1:240020', '1', 'http://www.activiti.org/processdef', '项目变更流程', 'projectChangeProcess', '1', '240017', '项目变更流程模型.bpmn20.xml', '项目变更流程模型.projectChangeProcess.png', '项目变更流程：\n申请人发起变更，科技项目经理进行确认，确认不通过则退回至发起人，通过后流向pmo初审；\npmo审批：驳回则退回到项目经理确认节点，通过则再判断条件：非重大项目 and 非重大变更 and 变更类型 等于 计划变更都成立时，归档并结束流程；条件不成立则启动oa系统中的流程，挂起当前流程，待oa系统的流程通过后回到当前流程，激活流程，判断是否为需求变更，不是的话直接归档当前流程；是需求变更的话，进行需求分析，分析驳回后退回到pmo初审，分析通过后进行需求分析确认节点，确认通过后流程归档。', '0', '1', '1', '');
INSERT INTO `act_re_procdef` VALUES ('requirementConfirmProcess_noProject:1:240008', '1', 'http://www.activiti.org/processdef', '立项流程', 'requirementConfirmProcess_noProject', '1', '240005', '立项流程模型.bpmn20.xml', '立项流程模型.requirementConfirmProcess_noProject.png', '立项流程：由业务经理提出并上传需求说明书，由架构师经理进行立项初审，立项初审通过后由发起人确认，确认通过后提交至oa系统相关流程，oa系统相关流程审批通过后由pmo进行实际立项；立项后归档至发起人。', '0', '1', '1', '');
INSERT INTO `act_re_procdef` VALUES ('requirementConfirmProcess_projected:1:240004', '1', 'http://www.activiti.org/processdef', '需求提交流程', 'requirementConfirmProcess_projected', '1', '240001', '需求提交流程模型.bpmn20.xml', '需求提交流程模型.requirementConfirmProcess_projected.png', '需求提交流程：由业务经理提出并上传需求说明书，由产品创新中心审批；产创审批人如果退回，则业务经理重新上传需求说明书；产创审批人如果确认则经产品经理进行需求分析；产品经理可以：1、驳回则退回至发起人重新申请，2、转发：指派给其他产品经理执行；3、自己先签收任务，然后下载需求说明书进行拆分明细后分析重命名，如果通过则指定各系统负责人，即业务经理确认；业务经理如果驳回，则退回至产品经理，业务经理如果确认通过，则流程归档至发起人。', '0', '1', '1', '');
